const About = () => {
  return (
    <div className="about">
      <Navbarr />
      <div className="about-box">
        <input type="text" placeholder="Texnology" />
        <h2>
          The Impact of Technology on the Workplace: How Technology is Changing
        </h2>
        <img src={img2} />
        <span> Jason Fransisco August 20, 2022</span>
        <article>
          <img src={articleimg} />
        </article>

      </div>
      <Footerr />
    </div>
  );
};

export default About;
